  \"2016-02-26T18:45:48.618229\",\n\t\"name\": \"nist-mems-calculator-srd-166\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This MEMS Calculator determines the following
  thin film properties from data taken with an optical interferometer or comparable
  instrument: a) residual strain from fixed-fixed beams, b) strain gradient from cantilevers,
  c) step heights or thicknesses from step-height test structures, and d) in-plane
  lengths or deflections. Then, residual stress and stress gradient calculations can
  be made after an optical vibrometer or comparable instrument is used to obtain Young's
  modulus from resonating cantilevers or fixed-fixed beams. In addition, wafer bond
  strength is determined from micro-chevron test structures using a material test
  machine.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
